import React from 'react';

const Card = () => {
    return(
        <div className='bg-light-green dib br3 pa3 ma3 grow bw9'>
            <img alt='robots' src='https://robohash.org/test?size=200x200' />
            <div>
                <h2>Jane Don</h2>
                <p>jane.done@gmail.com</p>
            </div>
        </div>
    );
}

export default Card;
